import React, { useContext, useEffect } from 'react'
import { UrlsContext } from '../contexts/UrlsContext'

const UrlsList = () => {
  const { urls, dispatch } = useContext(UrlsContext)

  useEffect(() => {
    console.log(urls)
  }, [urls])

  const handleClick = e => {
    dispatch({ type: 'DELETE_URL', id: { id: url.id } })
  }

  return (
    <div>
      <h1>Urls</h1>
      {urls.length !== 0 ? (
        urls.map(url => (
          <div key={url.id}>
            <p>{url.url}</p>
            <button onClick={handleClick}>Delete</button>
          </div>
        ))
      ) : (
        <p>No urls here!</p>
      )}
    </div>
  )
}

export default UrlsList
